import React from 'react'

class Listing extends React.Component {
    render(){
        return(
        <div>
            {this.props.tech.map((i) => {
                return(
                <div>
                    <img src={i.picture} alt='its a penis' />
                    <h2>{i.name}</h2>
                    <h2>${i.cost}</h2>
                    <h2>{i.description}</h2>
                    <h2>{i.user}</h2>
                </div>      
                )
            })}
         </div>
        )
    }
}

export default Listing
